import { Container, Grid } from "@mui/material";

import FilterProvider from "./context/FilterContext";
import UserTable from "./container/UserTable";
import Filter from "./container/Filter";

const App = () => {
	return (
		<>
			<FilterProvider>
				<Container maxWidth="false" style={{ paddingTop: "15px" }}>
					<Grid
						container
						spacing={2}
						style={{
							border: "solid rgba(224, 224, 224, 1)",
							borderWidth: "1px 0px 1px 1px",
						}}
					>
						<Grid
							item
							xs={12}
							sm={3}
							md={2}
							lg={2}
							xl={2}
							style={{ paddingTop: "0px" }}
						>
							<Filter />
						</Grid>
						<Grid
							item
							xs={11}
							sm={9}
							md={10}
							lg={10}
							xl={10}
							style={{ paddingTop: "0px" }}
						>
							<UserTable />
						</Grid>
					</Grid>
				</Container>
			</FilterProvider>
		</>
	);
};

export default App;
